import { Injectable } from '@angular/core';
let DatabaseEngine = DatabaseEngine_1 = class DatabaseEngine {
    static getDatabaseEngines() {
        return Object.keys(this.ENGINES)
            .reduce((acc, engineName) => {
            if (engineName == 'ORACLE') {
                acc.push(engineName);
            }
            return acc;
        }, [])
            .map((engineName) => {
            return {
                database: {
                    engine: engineName.toLowerCase(),
                    logo: this.ENGINES[engineName].logo
                },
                ddl: this.ENGINES[engineName].ddl
            };
        });
    }
    //Default is "ORACLE"
    static get(dbName = "ORACLE") {
        let engineExists = Object.keys(this.ENGINES)
            .find((item) => {
            return item == dbName;
        });
        if (!engineExists) {
            return {};
        }
        var t = {};
        for (let key in this.ENGINES[dbName].types) {
            if (this.ENGINES[dbName].types.hasOwnProperty(key)) {
                t[key] = this.ENGINES[dbName].types[key].toLowerCase();
            }
        }
        return t;
    }
    static oracle() {
        return [
            'create table if not exists hadouken (',
            [
                'state varchar2(25),',
                'supplier_id number(10) not null primary key,',
                '`cod_user` number(10) not null,',
                '`favorite_fruit` varchar2(10) default 10 not null,',
                'supplier_name varchar2(50) not null,',
                'status_supplier CHAR(1) default "Ok",',
                'address varchar2(50),',
                'city varchar2(50),',
                'state varchar2(25),',
                'dat_now date,',
                'zip_code number(10,2),price number(102),',
                'title VARCHAR(255) NOT NULL,',
                'start_date DATE,',
                'due_date DATE',
            ].map(d => `\t${d}`).join("\n"),
            ');',
            `CREATE TABLE shoryuken (`,
            [
                `ID NUMBER(11) NOT NULL,`,
                `your_column NUMBER(100) NOT NULL`,
            ].map(d => `\t${d}`).join("\n"),
            ');'
        ].join("\n");
    }
    static mysql() {
        return [
            `CREATE TABLE tasks (`,
            //`id BIGINT(11) NOT NULL AUTO_INCREMENT,`,
            `ID int NOT NULL UNIQUE,`,
            `bigint_col bigint NOT NULL AUTO_INCREMENT,`,
            `int_col INT UNIQUE,`,
            `smallint_col SMALLINT,`,
            `tinyint_col tinyint,`,
            `nickname VARCHAR(255) NOT NULL,`,
            `CHAR CHAR(50),`,
            `teste SET('up', 'down', 'right', 'left'),`,
            `deleted_at TIMESTAMP NULL,`,
            `created_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP NOT NULL,`,
            `joeys_world_tour enum('hue', 'oie', 'hadouken'),`,
            `updated_at varchar(255) DEFAULT 'Sandnes',`,
            `MEDIUMINT  MEDIUMINT UNSIGNED,`,
            `your_column DECIMAL(10) NOT NULL,`,
            `PRIMARY KEY (id)`,
            ');',
            `CREATE TABLE haoduken (`,
            //`id BIGINT(11) NOT NULL AUTO_INCREMENT,`,
            `ID int NOT NULL UNIQUE,`,
            `bigint_col bigint NOT NULL AUTO_INCREMENT,`,
            `your_column DECIMAL(10) NOT NULL,`,
            `PRIMARY KEY (id)`,
            `);`,
            `CREATE TABLE Orders (`,
            `OrderID int NOT NULL,`,
            `OrderNumber int NOT NULL,`,
            `PersonID int,`,
            `PRIMARY KEY (OrderID),`,
            `FOREIGN KEY (PersonID) REFERENCES Persons(PersonID)`,
            `);`
        ].join("\n");
    }
};
